import React from 'react';
import './styles.css';
import Header from './components/header';
import Routes from '../src/routes/routes';
import UserReducer from './reducers/UserReducer'


const App = () => (
    <UserReducer>
        <Header />,
        <Routes />
    </UserReducer>
);

export default App;
